import './post.css';

function Post() {
  return (
    <div className="post">
      <div className="post-wrapper">
        <div className="post-top"></div>
        <div className="post-center"></div>
        <div className="post-bottom "></div>
      </div>
    </div>
  );
}

export default Post;
